components:
 schemas:
  CFact:
   type: object
   properties:
    performer:
     type: string
     example: 'Martin'
    addressee:
     type: string
     example: 'Erik'
    intention:
     type: string
     example: rq
    product:
     $ref: '#/components/schemas/ProductKind'
  ProductKind:
   type: object
   oneOf:
    - type: object
      properties:
       StartedRegistration:
        $ref: '#/components/schemas/StartedRegistration'
    - type: object
      properties:
       AnnualRegistrationPayment:
        $ref: '#/components/schemas/AnnualRegistrationPayment'
    - type: object
      properties:
       EndedRegistration:
        $ref: '#/components/schemas/EndedRegistration'
    - type: object
      properties:
       TK04product:
        $ref: '#/components/schemas/TK04product'
  StartedRegistration:
   type: object
   properties:
    Registration:
     $ref: '#/components/schemas/Registration'
  AnnualRegistrationPayment:
   type: object
   properties:
    Registration:
     $ref: '#/components/schemas/Registration'
    Year:
     $ref: '#/components/schemas/Year'
  EndedRegistration:
   type: object
   properties:
    Registration:
     $ref: '#/components/schemas/Registration'
  TK04product:
   type: object
   properties:
    Year:
     $ref: '#/components/schemas/Year'
  Registration:
   type: object
   properties:
    member:
      $ref: '#/components/schemas/Person'
    payer:
      $ref: '#/components/schemas/Person'
  Person:
   type: object
   properties:
    day of birth:
     type: string
     format: date-time
    nationality:
      $ref: '#/components/schemas/Nationality'
  Year:
   type: object
   properties:
    year number:
     type: integer
  Nationality:
   type: string
